                    mock_gitea_tag_repo_mapping
                (repository_id, topic_id) VALUES (
                    (SELECT ID FROM mock_gitea_repositories WHERE name = $1),
                    (SELECT ID FROM mock_gitea_tags WHERE name = $2)
                );

